import React from 'react'
import { AppBar, Tabs, Toolbar, Typography, Tab } from '@mui/material';
import './Header.css';
import wtsp from './images/whatsapp.png';
import lnkdn from './images/linkedin.png';
import insta from './images/instagram.png';

const Header = () => {
    return (
        <React.Fragment>
            <AppBar className='Header'>
                <Toolbar>
                    <Tabs>
                        <Tab label="Home" />
                        <Tab label="About Us" />
                        <Tab label="Contact" />
                    </Tabs>
                    <Typography><button className='btn'><img src={insta} alt='instagram'/></button></Typography>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    )
}

export default Header
